function createTable(){itemsTable=$("#itemsTable").DataTable({responsive:!0,serverSide:!0,searchDelay:500,lengthMenu:[10,15,20],ajax:{url:"/api/product/items",data:{asin:productVM.product.asin}},columns:[{data:"sku"},{data:"alias"},{data:"color",orderable:!1},{data:"size",orderable:!1},{data:"invQty",width:50,orderable:!1},{width:120,orderable:!1,render:function(n,t,i){return'<button class="editBtn btn btn-sm btn-primary mr-2" type="button" data-toggle="modal" data-target="#itemModal"  data-id="'+i.sku+'">Edit<\/a><button class="delBtn btn btn-sm btn-danger" type="button" onclick="DeleteItem(\''+i.sku+"')\">Delete<\/button>"}}],columnDefs:[{className:"text-center",targets:[-1]}],order:[[0,"DESC"]]})}var itemsTable,orderVM=new Vue({el:"#app",data:{product:{asin:asinPara}},methods:{loadData:function(){var n=this;$.get("/api/admin/order/"+n.product.asin,function(t){t.imageUrl=$.isNW(t.imageUrl)?$.pic(null,150,150):$.pic(t.imageUrl);n.product=t})}},beforeMount:function(){var n=this;n.loadData()}}),itemVM=new Vue({el:"#itemModal",data:{isNew:!0,item:{sku:null,invQty:0}},methods:{loadData:function(){var n=this;n.isNew=$.isNW(n.item.sku);n.isNew?n.item={asin:productVM.product.asin,invQty:0}:$.get("/api/product/item",{asin:productVM.product.asin,sku:n.item.sku},function(t){n.item=t})},save:function(){var n=this,t=n.isNew?"POST":"PUT";return $.ajax({url:"/api/product/item",type:t,data:{ProductItem:n.item},success:function(n){$.isSuccess(n)?($("#itemModal").modal("toggle"),itemsTable.ajax.reload()):bootbox.alert(n)}}),!1}}});